function test_match(combo){
    return ((combo[0]+combo[1]+combo[2]+combo[3])/2 == (combo[4]+combo[5])/2);
}

function make_tsv(){
    var string = "";
    for (var i=0;i<matches.length;i++){
        var match = matches[i];
        string += match.join("\t") + "\n";
    }
    return string;
}

